Parentheses — () — are used to give precedence to inner expressions, as is the case in almost all languages / math. In particular, parentheses are used to nest pipelines for transforms such as group and window, which take a pipeline. Here, the aggregate pipeline is applied to each group of unique title and country values. from employees
group [title, country] ( aggregate [ average salary, ct = count ]
)

