dbt's use of macros has saved many of us many lines of code, and even saved some people some time. But imperatively programming text generation with code like if not loop.last is not our highest calling. It's the "necessary" part rather than beautiful part of dbt. Here's the canonical example of macros in the dbt documentation : {%- set payment_methods = ["bank_transfer", "credit_card", "gift_card"] -%} select
order_id,
{%- for payment_method in payment_methods %}
sum(case when payment_method = '{{payment_method}}' then amount end) as {{payment_method}}_amount
{%- if not loop.last %},{% endif -%}
{% endfor %}
from {{ ref('raw_payments') }}
group by 1 Here's that model using PRQL [1] , including the prql jinja tags. {% prql %}
func filter_amount method -> s"sum(case when payment_method = '{method}' then amount end) as {method}_amount" from {{ ref('raw_payments') }}
group order_id ( aggregate [ filter_amount bank_transfer, filter_amount credit_card, filter_amount gift_card, ]
)
{% endprql %} As well the query being simpler in its final form, writing in PRQL also gives us live feedback around any errors, on every keystroke. Though there's much more to come, check out the current version on PRQL Playground .

